import axios from 'axios'

const JSONName = 'rest-data'
const ROOT_API_URL = 'http://localhost:8080'
const REST_API_URL = `${ROOT_API_URL}/${JSONName}`

class CommentsDataService {

    retrieveAllBooks(name) {
        //console.log('executed service')
        return axios.get(`${REST_API_URL}/comments`);
    }

    retrieveBook(name, id) {
        //console.log('executed service')
        return axios.get(`${REST_API_URL}/comments/${id}`);
    }

    deleteBook(name, id) {
        //console.log('executed service')
        return axios.delete(`${REST_API_URL}/comments/${id}`);
    }

    updateBook(name, id, book) {
        //console.log('executed service')
        return axios.put(`${REST_API_URL}/comments/${id}`, book);
    }

    createBook(name, book) {
        //console.log('executed service')
        return axios.post(`${REST_API_URL}/comments/`, book);
    }
}

export default new CommentsDataService()
